func TestExtractLargestNumber(t *testing.T) {
	tests := []struct {
		name string
		text string
		want int
	}{
		{
			name: "single number",
			text: "phim-123",
			want: 123,
		},
		{
			name: "multiple numbers",
			text: "phim-45-episode-678",
			want: 678,
		},
		{
			name: "no numbers",
			text: "no-numbers-here",
			want: 0,
		},
		{
			name: "number at start",
			text: "999-phim",
			want: 999,
		},
		{
			name: "consecutive numbers",
			text: "123abc456def789",
			want: 789,
		},
		{
			name: "single digit",
			text: "episode-5",
			want: 5,
		},
		{
			name: "zero",
			text: "phim-0",
			want: 0,
		},
		{
			name: "large number",
			text: "id-123456789",
			want: 123456789,
		},
		{
			name: "empty string",
			text: "",
			want: 0,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := extractLargestNumber(tt.text); got != tt.want {
				t.Errorf("extractLargestNumber() = %v, want %v", got, tt.want)
			}
		})
	}
}

func TestAniVietSubExtractorDownload(t *testing.T) {
	tests := []struct {
		name    string
		episode Episode
		wantErr bool
	}{
		{
			name: "download fails on playlist retrieval",
			episode: Episode{
				MovieId: 999,
				Hash:    "invalid-hash",
			},
			wantErr: true,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			server := httptest.NewServer(http.HandlerFunc(func(w http.ResponseWriter, r *http.Request) {
				w.WriteHeader(http.StatusInternalServerError)
			}))
			defer server.Close()

			ex, _ := NewAniVietSubExtractor(server.URL)
			w := &bytes.Buffer{}
			err := ex.Download(tt.episode, w)
			if (err != nil) != tt.wantErr {
				t.Errorf("Download() error = %v, wantErr %v", err, tt.wantErr)
			}
		})
	}
}
